import logo from '../../asset/LOGONAME.png';
import classes from './Nav.module.css';

const Nav = () => {
  return (

    <nav className={classes.nav}>
      <img className={classes.logo} src={logo} alt='kardaclan logo'/>
      <ul className={classes.list}>
        <li className={classes.item}><a className={classes} href='/'>home</a></li>
        <li className={classes.item}><a className={classes} href='/'>about</a></li>
        <li className={classes.item}><a className={classes} href='/'>Project</a></li>
        <li className={classes.item}><a className={classes} href='/'>Media</a></li>
        <li className={classes.item}><a className={classes} href='/'>mortagage</a></li>
        <li className={classes.item}><a className={classes} href='/'>contact</a></li>
        </ul>
    </nav>
  )
}

export default Nav
